import React from "react";
import "./App.css";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";

function App() {
    return (
        <Router>
            <div className="App">
                <h1>Belajar Router</h1>

                <nav>
                    <Link to="/">Home</Link>&nbsp;|&nbsp;
                    <Link to="/about">About</Link>&nbsp;|&nbsp;
                    <Link to="/users">Users</Link>&nbsp;|&nbsp;
                    <Link to="/topics">Topics</Link>
                </nav>

                <Switch>
                    <Route path="/about">
                        <About />
                    </Route>
                    <Route path="/users">
                        <Users />
                    </Route>
                    <Route path="/topics">
                        <Topics />
                    </Route>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

const Home = () => (
    <div>
        <h2>Home</h2>
    </div>
);

const About = () => (
    <div>
        <h2>About</h2>
    </div>
);

const Users = () => (
    <div>
        <h2>Users</h2>
    </div>
);

const Topics = () => (
    <div>
        <h2>Topics</h2>
        <ul style={{listType:'none'}}>
            <li>
                <Link to="">Topic 1</Link>
            </li>
            <li>
                <Link to="">Topic 2</Link>
            </li>
            <li>
                <Link to="">Topic 3</Link>
            </li>
            <li>
                <Link to="">Topic 4</Link>
            </li>
        </ul>
    </div>
);

export default App;
